bool_t
xdr_fnClientDbConfiguration_rets (XDR *xdrs, fnClientDbConfiguration_rets *objp)
{
	register int32_t *buf;


	if (xdrs->x_op == XDR_ENCODE) {
		 if (!xdr_bool_t (xdrs, &objp->ReturnValue))
			 return FALSE;
		buf = XDR_INLINE (xdrs, 5 * BYTES_PER_XDR_UNIT);
		if (buf == NULL) {
			 if (!xdr_int (xdrs, &objp->pnFlags))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->pnMinimumKey))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->pnMaximumKey))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->pnKeyAlignment))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->nErrorLvl))
				 return FALSE;

		} else {
		IXDR_PUT_LONG(buf, objp->pnFlags);
		IXDR_PUT_LONG(buf, objp->pnMinimumKey);
		IXDR_PUT_LONG(buf, objp->pnMaximumKey);
		IXDR_PUT_LONG(buf, objp->pnKeyAlignment);
		IXDR_PUT_LONG(buf, objp->nErrorLvl);
		}
		 if (!xdr_string_t (xdrs, &objp->pszErrorMsg))
			 return FALSE;
		return TRUE;
	} else if (xdrs->x_op == XDR_DECODE) {
		 if (!xdr_bool_t (xdrs, &objp->ReturnValue))
			 return FALSE;
		buf = XDR_INLINE (xdrs, 5 * BYTES_PER_XDR_UNIT);
		if (buf == NULL) {
			 if (!xdr_int (xdrs, &objp->pnFlags))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->pnMinimumKey))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->pnMaximumKey))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->pnKeyAlignment))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->nErrorLvl))
				 return FALSE;

		} else {
		objp->pnFlags = IXDR_GET_LONG(buf);
		objp->pnMinimumKey = IXDR_GET_LONG(buf);
		objp->pnMaximumKey = IXDR_GET_LONG(buf);
		objp->pnKeyAlignment = IXDR_GET_LONG(buf);
		objp->nErrorLvl = IXDR_GET_LONG(buf);
		}
		 if (!xdr_string_t (xdrs, &objp->pszErrorMsg))
			 return FALSE;
	 return TRUE;
	}

	 if (!xdr_bool_t (xdrs, &objp->ReturnValue))
		 return FALSE;
	 if (!xdr_int (xdrs, &objp->pnFlags))
		 return FALSE;
	 if (!xdr_int (xdrs, &objp->pnMinimumKey))
		 return FALSE;
	 if (!xdr_int (xdrs, &objp->pnMaximumKey))
		 return FALSE;
	 if (!xdr_int (xdrs, &objp->pnKeyAlignment))
		 return FALSE;
	 if (!xdr_int (xdrs, &objp->nErrorLvl))
		 return FALSE;
	 if (!xdr_string_t (xdrs, &objp->pszErrorMsg))
		 return FALSE;
	return TRUE;
}

