bool_t
xdr_fnClientBtreepageItem_args (XDR *xdrs, fnClientBtreepageItem_args *objp)
{
	register int32_t *buf;


	if (xdrs->x_op == XDR_ENCODE) {
		 if (!xdr_SHORTOBJID (xdrs, &objp->oShortObjIdHeap))
			 return FALSE;
		 if (!xdr_SHORTOBJID (xdrs, &objp->oShortObjIdBTreePage))
			 return FALSE;
		buf = XDR_INLINE(xdrs,7 * BYTES_PER_XDR_UNIT);
		if (buf == NULL) {
			 if (!xdr_int (xdrs, &objp->nIndex))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->nItems))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->pnValueKeySize))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->pnTypeTagKeySize))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->pnValueDataSize))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->pnTypeTagDataSize))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->poNextSize))
				 return FALSE;
		} else {
			IXDR_PUT_LONG(buf, objp->nIndex);
			IXDR_PUT_LONG(buf, objp->nItems);
			IXDR_PUT_LONG(buf, objp->pnValueKeySize);
			IXDR_PUT_LONG(buf, objp->pnTypeTagKeySize);
			IXDR_PUT_LONG(buf, objp->pnValueDataSize);
			IXDR_PUT_LONG(buf, objp->pnTypeTagDataSize);
			IXDR_PUT_LONG(buf, objp->poNextSize);
		}
		return TRUE;
	} else if (xdrs->x_op == XDR_DECODE) {
		 if (!xdr_SHORTOBJID (xdrs, &objp->oShortObjIdHeap))
			 return FALSE;
		 if (!xdr_SHORTOBJID (xdrs, &objp->oShortObjIdBTreePage))
			 return FALSE;
		buf = XDR_INLINE(xdrs,7 * BYTES_PER_XDR_UNIT);
		if (buf == NULL) {
			 if (!xdr_int (xdrs, &objp->nIndex))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->nItems))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->pnValueKeySize))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->pnTypeTagKeySize))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->pnValueDataSize))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->pnTypeTagDataSize))
				 return FALSE;
			 if (!xdr_int (xdrs, &objp->poNextSize))
				 return FALSE;
		} else {
			objp->nIndex = IXDR_GET_LONG(buf);
			objp->nItems = IXDR_GET_LONG(buf);
			objp->pnValueKeySize = IXDR_GET_LONG(buf);
			objp->pnTypeTagKeySize = IXDR_GET_LONG(buf);
			objp->pnValueDataSize = IXDR_GET_LONG(buf);
			objp->pnTypeTagDataSize = IXDR_GET_LONG(buf);
			objp->poNextSize = IXDR_GET_LONG(buf);
		}
	 return TRUE;
	}

	 if (!xdr_SHORTOBJID (xdrs, &objp->oShortObjIdHeap))
		 return FALSE;
	 if (!xdr_SHORTOBJID (xdrs, &objp->oShortObjIdBTreePage))
		 return FALSE;
	 if (!xdr_int (xdrs, &objp->nIndex))
		 return FALSE;
	 if (!xdr_int (xdrs, &objp->nItems))
		 return FALSE;
	 if (!xdr_int (xdrs, &objp->pnValueKeySize))
		 return FALSE;
	 if (!xdr_int (xdrs, &objp->pnTypeTagKeySize))
		 return FALSE;
	 if (!xdr_int (xdrs, &objp->pnValueDataSize))
		 return FALSE;
	 if (!xdr_int (xdrs, &objp->pnTypeTagDataSize))
		 return FALSE;
	 if (!xdr_int (xdrs, &objp->poNextSize))
		 return FALSE;
	return TRUE;
}




















































































































































































































































































































































